import React from "react";
import Boho from "../video/Boho.mp4";

const Settings = () =>{
    return (
        <div>
         <video autoPlay loop muted
         style={{

             position: "absolute",
             width: "100%",
             left: "5%",
             height: "100%",
             objectFir: "cover",
             transform: "translate(-50%, -50%)",
             zIndex: "-1",


         }}
         >


        <source src={Boho} type="video/mp4"/>

         </video>
        </div>
    )
}


export default Settings
